import classes from './Profile.module.css'
import MyPosts from './My posts/MyPosts'
import ProfileInfo from './ProfileInfo/ProfileInfo'
// import Post from './My posts/Post/Post'

function Profile(props) {

  return (
    <div className={classes.content}>
      <ProfileInfo picture={props.profilePage.profiles.background} avatar={props.profilePage.profiles[0].avatar} />
      <MyPosts dispatch={props.dispatch} posts={props.profilePage.posts} postText={props.profilePage.postText}/>
    </div>
  )
}

export default Profile
